);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"1184623","type":"CustomJS"},{"attributes":{"fill_alpha":{"value":0.2},"fill_color":{"value":"red"},"hatch_alpha":{"value":0.2},"hatch_color":{"value":"red"},"line_alpha":{"value":0.2},"line_color":{"value":"red"},"size":{"value":8},"x":{"value":1250},"y":{"value":0.22913699300000012}},"id":"1184409","type":"Scatter"},{"attributes":{"source":{"id":"1184552"}},"id":"1184558","type":"CDSView"},{"attributes":{"fill_alpha":{"value":0.1},"fill_color":{"field":"returns_positive","transform":{"id":"1184307"}},"hatch_alpha":{"value":0.1},"line_alpha":{"value":0.1},"marker":{"value":"triangle"},"size":{"field":"marker_size"},"x":{"field":"index"},"y":{"field":"returns_long"}},"id":"1184493","type":"Scatter"},{"attributes":{},"id":"1184285","type":"BasicTicker"},{"attributes":{},"id":"1184375","type":"Selection"},{"attributes":{"coordinates":null,"data_source":{"id":"1184304"},"glyph":{"id":"1184352"},"group":null,"hover_glyph":null,"muted_glyph":{"id":"1184354"},"nonselection_glyph":{"id":"1184353"},"view":{"id":"1184356"}},"id":"1184355","type":"GlyphRenderer"},{"attributes":{"source":{"id":"1184406"}},"id":"1184411","type":"CDSView"},{"attributes":{"data":{"equity_dd":{"__nd
